  false,\n\t\"url\": null,\n\t\"notes\": \"OPEN_DUMPS_IDEM_IN is a point shapefile
  that contains open dump site locations in Indiana, provided by personnel of Indiana
  Department of Environmental Management, Office of Land Quality (IDEM, OLQ) as of
  July 11, 2003 and was subsequently updated on June 3, 2004, January 4, 2005, April
  25, 2005, July 27, 2006, January 24, 2007, June 4, 2009, October 20, 2009, and April
  16, 2010. The data set provided by IDEM was in an ESRI geodatabase format and the
  feature class was named \"OPEN_DUMP.\" OPEN_DUMPS_IDEM_IN is attributed with facility
  names and federal identification numbers. The following is excerpted from the metadata
  provided by IDEM, OLQ for the source shapefile OPEN_DUMP: \"This dataset consists
  of Open Dumps - Sites that are not regulated and are illegal dump sites of solid
  waste, as defined by IAC 10-2-28 329 and IAC 10-2-128 of the Indiana Administrative
  Code.\"\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
